import React from "react";
import MG from "./MG";
import './Plant.css';
function Plant(prop){
    console.log("plant.js"+JSON.stringify(prop.currentItems.length))
  
    return(
        <div className="plant">
           {prop.currentItems.length?<MG mg={prop.currentItems}/>:<div style={{color:"gray","textAlign":"justify"}}><h1>Next Plant&gt;&gt;&gt;</h1></div>}
            
        </div>
    
    )
}
export default Plant;
